{
  "translationLines": [
    {
      "lineNumber": 64021,
      "originalJapaneseLine": "　傘ちゃんと持っててくれよ、",
      "translatedEnglishLine": "Hold the umbrella properly, will you?"
    },
    {
      "lineNumber": 64022,
      "originalJapaneseLine": "　アニキがハンバーグになっちまう」",
      "translatedEnglishLine": "Big brother might turn into a hamburger."
    },
    {
      "lineNumber": 64023,
      "originalJapaneseLine": "「うん！　あんがとー！」",
      "translatedEnglishLine": "\"Yeah! Thanks!\""
    },
    {
      "lineNumber": 64024,
      "originalJapaneseLine": "「……まったく、手間かけさせやがって」",
      "translatedEnglishLine": "\"...Geez, you're making me go through so much trouble.\""
    },
    {
      "lineNumber": 64025,
      "originalJapaneseLine": "「ふふっ。アルカネーゼさんに",
      "translatedEnglishLine": "\"Hehe. Arkaneze-san beat us to it.\""
    },
    {
      "lineNumber": 64026,
      "originalJapaneseLine": "　先を越されちゃいましたね」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 64027,
      "originalJapaneseLine": "「何をほざくか」",
      "translatedEnglishLine": "\"What the hell are you babbling about?\""
    },
    {
      "lineNumber": 64028,
      "originalJapaneseLine": "「あいたっ」",
      "translatedEnglishLine": "\"Ouch!\""
    },
    {
      "lineNumber": 64029,
      "originalJapaneseLine": "「さ、行くぜアニキー」",
      "translatedEnglishLine": "\"Alright, let's go, big brother!\""
    },
    {
      "lineNumber": 64030,
      "originalJapaneseLine": "「行くぜ！」",
      "translatedEnglishLine": "\"Let's go!\""
    },
    {
      "lineNumber": 64031,
      "originalJapaneseLine": "「分かっとるわ。",
      "translatedEnglishLine": "\"I know."
    },
    {
      "lineNumber": 64032,
      "originalJapaneseLine": "　おいナギ、傘を上げすぎるんじゃないぞ」",
      "translatedEnglishLine": "Hey Nagi, don't raise the umbrella too high.\""
    },
    {
      "lineNumber": 64033,
      "originalJapaneseLine": "「はいはーい」",
      "translatedEnglishLine": "\"Yeah, yeah!\""
    },
    {
      "lineNumber": 64034,
      "originalJapaneseLine": "現在、標高2000メートル。",
      "translatedEnglishLine": "Currently, at an altitude of 2,000 meters."
    },
    {
      "lineNumber": 64035,
      "originalJapaneseLine": "衛星兵器は、まだまだ高みから",
      "translatedEnglishLine": "The satellite weapon was still looking down"
    },
    {
      "lineNumber": 64036,
      "originalJapaneseLine": "ランスを見下ろしていた。",
      "translatedEnglishLine": "on Rance from far above."
    },
    {
      "lineNumber": 64037,
      "originalJapaneseLine": "「はぁ、ふぅ……」",
      "translatedEnglishLine": "\"Haa, huu...\""
    },
    {
      "lineNumber": 64038,
      "originalJapaneseLine": "「……だいじょぶ？　香ちゃん」",
      "translatedEnglishLine": "\"...Are you okay, Kaoru-chan?\""
    },
    {
      "lineNumber": 64039,
      "originalJapaneseLine": "「はい、体力は……ただ、空気が薄くて……」",
      "translatedEnglishLine": "\"Yes, my stamina is fine... but the air is thin...\""
    },
    {
      "lineNumber": 64040,
      "originalJapaneseLine": "「あー、そうだよねぇ……息苦しいったら……",
      "translatedEnglishLine": "\"Ah, yeah... It's suffocating..."
    },
    {
      "lineNumber": 64041,
      "originalJapaneseLine": "　それに……う、寒くなってきたかな……」",
      "translatedEnglishLine": "And also... ugh, it's starting to get cold...\""
    },
    {
      "lineNumber": 64042,
      "originalJapaneseLine": "「は、はい……魔法で、暖めてもらってる",
      "translatedEnglishLine": "\"Y-yes... I'm supposed to be warmed by magic,"
    },
    {
      "lineNumber": 64043,
      "originalJapaneseLine": "　はずなんですけど……」",
      "translatedEnglishLine": "but...\""
    },
    {
      "lineNumber": 64044,
      "originalJapaneseLine": "「い、今、どのくらいなんですか……はぁふぅ……",
      "translatedEnglishLine": "\"How high are we now...? Haa, huu...\""
    },
    {
      "lineNumber": 64045,
      "originalJapaneseLine": "　もう、雲海がだいぶ下までいったんですけど……」",
      "translatedEnglishLine": "The sea of clouds has already gone down quite far...\""
    },
    {
      "lineNumber": 64046,
      "originalJapaneseLine": "「ううん……だいたい、5000くらいね……",
      "translatedEnglishLine": "\"No... roughly around 5,000 meters...\""
    },
    {
      "lineNumber": 64047,
      "originalJapaneseLine": "　半分くらいだと思っといたほうがいい、かな」",
      "translatedEnglishLine": "It's probably best to think we're about halfway there.\""
    },
    {
      "lineNumber": 64048,
      "originalJapaneseLine": "「半分！？　まだまだじゃないですかー。",
      "translatedEnglishLine": "\"Halfway!? We're still far from there!"
    },
    {
      "lineNumber": 64049,
      "originalJapaneseLine": "　うう、寒い眠いお腹空いたよー……」",
      "translatedEnglishLine": "Ugh, cold, sleepy, and hungry...\""
    },
    {
      "lineNumber": 64050,
      "originalJapaneseLine": "（という割にはまだまだ余裕ありそうなのよね、",
      "translatedEnglishLine": "(For all that, she still seems to have plenty of energy,"
    },
    {
      "lineNumber": 64051,
      "originalJapaneseLine": "　この子…………）",
      "translatedEnglishLine": "this girl...)"
    },
    {
      "lineNumber": 64052,
      "originalJapaneseLine": "と、その時。",
      "translatedEnglishLine": "And then, at that moment."
    },
    {
      "lineNumber": 64053,
      "originalJapaneseLine": "不意に、遠くからの鳴き声が一行を襲った。",
      "translatedEnglishLine": "Suddenly, a distant roar attacked the group."
    },
    {
      "lineNumber": 64054,
      "originalJapaneseLine": "「あれ、なんでしょうこの声……」",
      "translatedEnglishLine": "\"Huh, what's that sound...?\""
    },
    {
      "lineNumber": 64055,
      "originalJapaneseLine": "「…………！　あれ！　ランス！　ドラゴンだわ！」",
      "translatedEnglishLine": "\"...! There! Rance! It's dragons!\""
    },
    {
      "lineNumber": 64056,
      "originalJapaneseLine": "「おいでなすったか……！」",
      "translatedEnglishLine": "\"So they came...!\""
    },
    {
      "lineNumber": 64057,
      "originalJapaneseLine": "「ったく、なんでだか知らんが、",
      "translatedEnglishLine": "\"Damn it, I don’t know why,"
    },
    {
      "lineNumber": 64058,
      "originalJapaneseLine": "　ここにはドラゴンどもが住み着いてやがるからな」",
      "translatedEnglishLine": "but dragons have made their home here.\""
    },
    {
      "lineNumber": 64059,
      "originalJapaneseLine": "「邪魔するんなら叩き斬るだけだ！　やるぞ！」",
      "translatedEnglishLine": "\"If they interfere, we'll just cut them down! Let's go!\""
    },
    {
      "lineNumber": 64060,
      "originalJapaneseLine": "「…………ちっ」",
      "translatedEnglishLine": "\"...Tch.\""
    },
    {
      "lineNumber": 64061,
      "originalJapaneseLine": "「アニキ？」",
      "translatedEnglishLine": "\"Big brother?\""
    },
    {
      "lineNumber": 64062,
      "originalJapaneseLine": "前方を睨みつけて、ランスが煩わしげに舌を打った。",
      "translatedEnglishLine": "Glaring ahead, Rance clicked his tongue irritably."
    },
    {
      "lineNumber": 64063,
      "originalJapaneseLine": "「あそこだ。またドラゴンがいやがる」",
      "translatedEnglishLine": "\"There. More dragons hanging around again.\""
    },
    {
      "lineNumber": 64064,
      "originalJapaneseLine": "「あー……ホントだ。沢山いるなぁ……」",
      "translatedEnglishLine": "\"Ah... You're right. There are a lot of them...\""
    },
    {
      "lineNumber": 64065,
      "originalJapaneseLine": "「まったく、いちいち邪魔してきやがる。",
      "translatedEnglishLine": "\"Seriously, they keep getting in our way every single time."
    },
    {
      "lineNumber": 64066,
      "originalJapaneseLine": "　こっちはあんな爬虫類どもに用はないんだ」",
      "translatedEnglishLine": "We have no use for those reptiles.\""
    },
    {
      "lineNumber": 64067,
      "originalJapaneseLine": "「あいつらにしてみたら……なんだろ。",
      "translatedEnglishLine": "\"For those guys... I wonder what it’s like."
    },
    {
      "lineNumber": 64068,
      "originalJapaneseLine": "　自分の家に踏み込まれてるようなものなのかなー」",
      "translatedEnglishLine": "Maybe it's like we're trespassing in their home.\""
    },
    {
      "lineNumber": 64069,
      "originalJapaneseLine": "「はるまきはこんなにいい子なのにねー」",
      "translatedEnglishLine": "\"Harumaki is such a good girl though...\""
    },
    {
      "lineNumber": 64070,
      "originalJapaneseLine": "「がぁー」",
      "translatedEnglishLine": "\"Guaaah!\""
    }
  ]
}

